import { Theme } from '@emotion/react';

export const colors: Theme = {
	white: '#ffffff',
	black: 'rgba(0, 0, 0, 0.8)',
	grey: '#fafafa',
	grey2: '#bcbcbd',
	grey3: '#c9c9c9',
	grey4: 'grey',
	blue: '#74acfc',
	blue2: '#1575fb',
};
